        <form className="signup-form">
           <div className="form-group">
             <input type="text" className="form-input" name="name" placeholder="Enter" />
           </div>
        </form>
        <p>dsbjhdhsg</p>
        <button className="btn btn-primary">dsd</button>
      </div>
    );
  }
}

export default Signup;
